window.bookSummaryJSON = "<p><i>New York Times</i> and <i>USA Today</i> best-selling author Molly McAdams delivers the first captivating, stand-alone novel in her Redemption series spin-off - the Rebel series....</p> <p>I’m not the kind of girl you forget. <br> I wish I was. <br> I wish I was normal. <br> That I could blend into a crowd. Have a future with the man I’ve loved my entire life....</p> <p>Maxon James understands me in a way others can’t. For as long as I can remember, he’s vowed that one day he would claim my wild, rebel heart. God knows I wanted him to try. I wanted the life he promised me in his lyrics. </p> <p>But his assurances couldn’t change the past, and the infamous mafia blood in my veins guarantees my heart <i>can’t </i>be claimed. </p> <p>Somewhere along the way, I slipped. I let myself believe we could have it all. Now a dark, menacing shadow hovers between us, mocking us for daring to hope for a normal future. </p> <p>And it’s come to collect on a blood oath. My name’s Elizabeth Borello - Libby for short. Don’t worry about forgetting it.... <i>He </i>hasn’t.</p>"; 
